import React, { useState } from 'react';
import axios from 'axios';

function Side_work() {
  const [images, setImages] = useState([]);

  const fetchData = async () => {
    try {
      const response = await axios.get('https://picsum.photos/v2/list?page=2&limit=15');
      setImages(response.data); // store all image objects
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  return (
    <div className='d-flex flex-column justify-content-center align-items-center mt-5'>
      <button onClick={fetchData} className='btn btn-danger mb-3'>
        Fetch Images
      </button>

      <div className='d-flex flex-wrap justify-content-center'>
        {images.map((img) => (
          <img
            key={img.id}
            src={img.download_url}
            alt={img.author}
            style={{ width: '150px', margin: '5px', borderRadius: '5px' }}
          />
        ))}
      </div>
    </div>
  );
}

export default Side_work;
